_P_XP2_PREMIUM_WDESC_KNIFE_RAZOR:"模型90為先進的戰鬥用刀，是具鋒利剃刀的重型戰鬥用刀，刀部分為鋸齒狀，尖端設有掏鉤。這款刀的獨特之處在於從後方接近目標時，能迅速俐落又安靜地殺死對方。從正面多次橫砍攻擊會致命，但卻會得不到狗牌戰利品。",BF3_ID_P_XP2_PREMIUM_WNAME_KNIFE_RAZOR:"ACB-90",BF3_ID_P_XP2_WDESC_ACR:"此款適合戰鬥用步槍以若干新近的步槍設計為特色，可作為重量輕、功能重的步槍平台。使用現代、低後坐力的“Grendel”子彈，能承受惡劣天候條件，並能充分利用標準STANAG彈匣，這款步槍的裝備能滿足許多軍事和執法用途之要求。",BF3_ID_P_XP2_WDESC_HK417:"此款較M416大，以較重的16英寸槍管及放大的接收器為特徵，能夠應付重型的7.62子彈。這款步槍準度高，具強大制動力，是理想的精確射手步槍（DMR），目前為全球許多軍隊採用。",BF3_ID_P_XP2_WDESC_JNG90:"其巨大的槍口制退器很容易識別，JNG-90為土耳其軍隊的制式狙擊步槍。這款現代步槍有完整的導軌系統和許多其他的配件選項，因而能夠隨機應變。提供射手強大的制動力，以及次佳的MOA準度。",BF3_ID_P_XP2_WDESC_L86A1:"旨在提供火力支援給較小的步兵團，此款英製SA80系列步槍配備了延伸槍管，有效射程絕佳。原​​打算作為輕機槍，由於其在較長射程中的優異性能，已逐漸轉為射手專用。由於非彈帶給彈使其持續射擊的能力受限，而可靠的準度使它成為任一部隊的戰力倍增器。",BF3_ID_P_XP2_WDESC_LSAT:"這款美國JSSAP原型是為了大幅降低小型武器及其彈藥重量。此輕機槍原型使用高燃點推進劑，以彈帶輸送無殼彈藥為特色。若此計劃成功，這款武器系統可能給部隊目前所用較笨重累贅的自動武器帶來重大改良。",BF3_ID_P_XP2_WDESC_MP5K:"以世界上最成功的衝鋒槍為基礎所設計的戰術機動手槍。完全去除肩托，有縮短的接收器，這款超小型的個人防衛武器具有很高射速，以及強大的近距離制動力。",BF3_ID_P_XP2_WDESC_MTAR21:"這款無托式卡賓槍為以色列軍隊制式TAR-21步槍的超小版。以最高的人體工學處理為特徵，長度僅590毫米（23.2英寸）是為了在窄小的環境下使用，這種空間如用標準長度步槍會很累贅。它在2009年注定要成為IDF的制式步槍，國際上也有安全部隊和警察部隊使用。",BF3_ID_P_XP2_WDESC_SCARL:"SCAR步槍系統的模塊化設計允許眾多不同的配置。Mk. 16 “SCAR-L”，以14英寸的槍管以及完整的30發彈匣為特徵。相較於其擁有20發子彈的卡賓槍對手，SCAR-L為較重型的Mk. 17，在較長射程中，由於槍管長度延長拿下目標的表現較佳，而且具可管理的後坐力，能更有效地控制火力。",BF3_ID_P_XP2_WDESC_SPAS12:"這款義大利製標誌性獵槍，自80年代推出以來已大獲成功。它之所以風靡全球，主要由於能應付種類繁多的子彈類型。其獨特的彈匣設計進一步簡化了不同彈藥的使用，讓SPAS-12持續受全球警察和部隊的高度重視。",BF3_ID_P_XP2_WDESC_STEYRAUG:"這款5.56無托式設計為70年代所開發，雖高度模塊化，確又充分靈巧。自1977年起成為奧地利軍隊的制式步槍，出口成績斐然，全球愛用者稱讚其耐用性與出色的操控性。",BF3_ID_P_XP2_WNAME_ACR:"ACW-R",BF3_ID_P_XP2_WNAME_HK417:"M417",BF3_ID_P_XP2_WNAME_JNG90:"JNG-90",BF3_ID_P_XP2_WNAME_L86A1:"L86A2",BF3_ID_P_XP2_WNAME_LSAT:"LSAT",BF3_ID_P_XP2_WNAME_MP5K:"M5K",BF3_ID_P_XP2_WNAME_MTAR21:"MTAR-21",BF3_ID_P_XP2_WNAME_SCARL:"SCAR-L",BF3_ID_P_XP2_WNAME_SPAS12:"SPAS-12",BF3_ID_P_XP2_WNAME_STEYRAUG:"AUG A3",BF3_ID_P_XP2_XPACK_DESC_01:"贏了一回合隊制征服戰",BF3_ID_P_XP2_XPACK_DESC_02:"已完成一回合《槍神》",BF3_ID_P_XP2_XPACK_DESC_03:"墮下史巴塔",BF3_ID_P_XP2_XPACK_DESC_04:"在不死的情況下用卡賓槍、手槍和火箭發射器殺了一人",BF3_ID_